import Layout from '../components/layout';
import { Paper } from '@material-ui/core';

export default function() {
  return (
    <React.Fragment>
      <Layout>
        <Paper elevation={3} className="button-container">
          Hi
        </Paper>
      </Layout>
      <style jsx>
        {`
          .button-container: {
            width: 400px;
            height: 400px;
          }
        `}
      </style>
    </React.Fragment>
  );
}
